import React from "react";
import Card from "../card";

const Times = (props) => {
    return(
        <section style={{backgroundColor: props.corSecundaria}} className="p-10 text-center">
           <h3>{props.nome}</h3>
           {props.atletas.map(atleta => 
           <Card 
                nome={atleta.nome} 
                cargo={props.cargo} 
                imagem={props.imagem}
           />)}
        </section>
    )
}
export default Times;
